import React from "react";
import jsPDF from "jspdf";
import ResumeData from "../ResumeData";
const Resume = () => {
  ResumeData.map((val, index) => {
    return (
      <Card
        key={index}
        imgsrc={val.imgsrc}
        text={val.text}
        title={val.title}
        url={val.url}
      />
    );
  });

  genResume = () => {
    var doc = new jsPDF("p", "pt");

    doc.text(20, 20);
  };

  return (
    <section id="app">
      <div id="resume" className="Resume">
        <div className="heading">WELCOME TO MY RESUME PAGE</div>
      </div>
    </section>
  );
};

export default Resume;
